using Microsoft.AspNetCore.Identity;
using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.Metadata.Builders;
using SimplyForum.Infrastructure.Data.Models;

namespace SimplyForum.Infrastructure.Data.Configuration
{
    public class ApplicationUserConfiguration : IEntityTypeConfiguration<ApplicationUser>
    {
        public void Configure(EntityTypeBuilder<ApplicationUser> builder)
        {
            builder.HasData(CreateUsers());       
        }

        private List<ApplicationUser> CreateUsers()
        {
            var users = new List<ApplicationUser>();
            var hasher = new PasswordHasher<ApplicationUser>();

            string stringFromSQL = "";
            List<byte> byteList = new List<byte>();

            string hexPart = stringFromSQL.Substring(2);
            for (int i = 0; i < hexPart.Length / 2; i++)
            {
                string hexNumber = hexPart.Substring(i * 2, 2);
                byteList.Add((byte)Convert.ToInt32(hexNumber, 16));
            }

            byte[] original = byteList.ToArray();

            var user = new ApplicationUser()
            {
                Id = "477194ee-abb3-40c2-9e5b-9c7222ed600f",
                UserName = "User",
                NormalizedUserName = "USER",
                Email = "user@user.com",
                NormalizedEmail = "USER@USER.COM",
                EmailConfirmed = true,
                ProfilePicture = original
            };

            user.PasswordHash = hasher.HashPassword(user, "123456789");

            users.Add(user);

            user = new ApplicationUser()
            {
                Id = "e84bc3c9-cf00-462a-8505-9ae520533e85",
                UserName = "SecondUser",
                NormalizedUserName = "SECONDUSER",
                Email = "seconduser@user.com",
                NormalizedEmail = "SECOND@USER.COM",
                EmailConfirmed = true,
                ProfilePicture = original
            };

            user.PasswordHash = hasher.HashPassword(user, "123456789");

            users.Add(user);

            user = new ApplicationUser()
            {
                Id = "648a1ea7-a0d3-4aba-8316-cd702f2be4d9",
                UserName = "admin",
                NormalizedUserName = "ADMIN",
                Email = "admin@admin.bg",
                NormalizedEmail = "ADMIN@ADMIN.BG",
                EmailConfirmed = true,
                ProfilePicture = original
            };

            user.PasswordHash = hasher.HashPassword(user, "admin123");

            users.Add(user);

            return users;
        }
    }
}
